import React from "react";
import images from "../../assets";
import constants from "./constants";
import {
  BuyButton,
  BuyBanner,
  BuyContainer,
  HeaderContainer,
  Logo,
  RentBanner,
  RentButton,
  RentContainer,
} from "./styles";

export default function Home() {
  return (
    <>
      <HeaderContainer>
        <Logo src={images.houseLogo}></Logo>
      </HeaderContainer>
      Navbar placeholder
      <RentContainer>
        <RentBanner>
          <>{constants.rentProperty.title}</>
          <>{constants.rentProperty.description}</>
        </RentBanner>

        <RentButton>{constants.rentProperty.button}</RentButton>
        <div>slider</div>
      </RentContainer>
      <BuyContainer>
        <BuyBanner></BuyBanner>
        <BuyButton>CLick to buy</BuyButton>
        <div>slider</div>
      </BuyContainer>
    </>
  );
}
